import { Component, Input, OnInit } from '@angular/core';
import { MenuController } from '@ionic/angular';
import { Reporte } from 'src/app/models/interface';

@Component({
  selector: 'app-reportes',
  templateUrl: './reportes.component.html',
  styleUrls: ['./reportes.component.scss'],
})
export class ReportesComponent implements OnInit {
  @Input()reporte!: Reporte;
  constructor(public menuController: MenuController,) { }

  ngOnInit() {}
 
}
<ion-card>
  <ion-item class="normal"><label class="pequeña">Nombre: {{reporte.nombre}} </label></ion-item>
  <ion-item class="pequeña"><label class="pequeña">Identificador: {{reporte.identificador}}</label></ion-item>
  <ion-item class="pequeña"><label class="pequeña">Edad: {{reporte.edad}}</label></ion-item>
  <ion-item class="pequeña"><label class="pequeña">Peso: {{reporte.peso}}</label></ion-item>
  <ion-item class="pequeña"><label class="pequeña">Altura: {{reporte.altura}}</label></ion-item>
  <ion-item class="normal"><label class="pequeña">Medicamentos: {{reporte.medicamentos}}</label></ion-item>
  <ion-item class="pequeña"><label class="pequeña">Condicion medica: {{reporte.condicion}}</label></ion-item>
</ion-card>
